@times(100)
def func1(data):
    return {frozenset(edge) for edge in zip(data, data[1:] + data[:1])}


@times(100)
def func2(data):
    return {frozenset(edge) for edge in pairwise(data + data[:1])}


@times(100)
def func3(data):
    return set(map(frozenset, pairwise(data + data[:1])))


@times(100)
def func4(data):
    return set(map(frozenset, zip(data, data[1:] + data[:1])))


@times(500)
def func5(data):
    return {*map(frozenset, pairwise(data + data[:1]))}


@times(500)
def func6(data):
    return {*map(frozenset, zip(data, data[1:] + data[:1]))}


@times(1000)
def eadjs(edges, EA):
    """
    Edges parallel to and one unit length distance away from each edge in self.edges.
    """
    return {*chain.from_iterable(map(lambda edge: EA[edge], edges))}


@times(1000)
def eadjs1(edges, EA):
    """
    Edges parallel to and one unit length distance away from each edge in self.edges.
    """
    return {eadj for edge in edges for eadj in EA[edge]}


